(35, 1, '2018-11-24 17:31:07', '2018-11-24 17:31:07', 'We provide clinical substance abuse assessments for United States citizens abroad who have encountered legal charges in other countries involving alcohol or illicit drug use in a variety of circumstances and situations.\r\n\r\nPlease contact us to discuss your situation and determine if we can help. All assessment determinations are made using American Psychiatric Association DSM-5 diagnostic criteria.\r\n\r\nYour assessment report is provided to you for your own purposes and it is at your discretion if you wish courts, legal, and/or medical professionals to review it.\r\n\r\nCan be done via Phone, Webcam or in person depending on your location.\r\n', 'International Substance Abuse Assessment', '', 'publish', 'closed', 'closed', '', 'international-substance-abuse-assessment', '', '', '2018-12-29 00:36:41', '2018-12-29 00:36:41', '', 0, 'https://myphpdevelopers.com/dev/drugsandalcoholassessment/?post_type=drg_product&#038;p=35', 0, 'drg_product', '', 0),
(36, 1, '2018-11-24 17:31:22', '2018-11-24 17:31:22', 'Family Courts sometimes make a finding that there is sufficient evidence of habitual, frequent or continual illegal use of alcohol or drugs by a parent. The courts take substance abuse related issues extremely seriously in child custody cases. Keep in mind it is not enough just to show the parent uses alcohol or illicit drugs, but the frequency of use and the impact it has on the parents ability to take care of his or her child. Criminal charges, convictions, and incarceration are significant factors of consideration in these cases.\r\n\r\nFamily Courts typically assign drug and alcohol abuse cases to qualified alcohol and drug assessment group to conduct an evaluation and examination of the parent to determine the seriousness of the substance abuse as well as to make recommendations the court can take in consideration.\r\n\r\nOften family court requires the assessor to interview third parties and review documentation to take in account the facts of the case as known to the court. Our clinical child custody or divorce drug & alcohol assessment provides you with an accurate, timely and above all professional report to the court which acknowledges past or existing problems but distinguishes between incidental alcohol and drug use versus problematic and dependent alcohol and drug use.\r\n\r\nIn the case of divorce, courts take substance abuse issues very seriously. For example, alimony; a spouse with an alcohol or drug problem who has drained the couples finances could be ordered to pay additional alimony for using the couples financial resources to pay for his or her alcohol and/or drug dependence.\r\n\r\nOn the other hand, in rarer cases, the sober spouse may be required to pay for the addicted spouses costs of treatment not covered by disability benefits. Either way, a professional clinical substance abuse assessment is often assigned to these cases to determine if a substance related disorder exists and the extent of the problem. As in child custody substance abuse assessments, the court often requires the assessor to interview third parties and review documentation to take in account the facts of the case as known to the court in determining the assessment results.\r\n', 'Child Custody/Divorce Substance Abuse Assessment', '', 'publish', 'closed', 'closed', '', 'child-custody', '', '', '2018-12-29 00:36:18', '2018-12-29 00:36:18', '', 0, 'https://myphpdevelopers.com/dev/drugsandalcoholassessment/?post_type=drg_product&#038;p=36', 0, 'drg_product', '', 0),
(37, 1, '2018-11-24 17:31:46', '2018-11-24 17:31:46', 'Employees working under the umbrella of the DOT in violation of the Department of Transportation Federal Drug and Alcohol Testing rules (49 C.F.R.  40) are under strict parameters before being allowed to return to duty or be hired to perform work in a safety sensitive position. These drug and alcohol assessments for DOT employee can only be performed by a qualified SAP (Substance Abuse Professional) who has obtained additional training and certification to conduct such assessments per Federal regulation. Per Federal regulation all DOT/SAP assessments must be performed in person. Please contact us to discuss your situation and location to determine if our services are appropriate for you.\r\n\r\nIf you do not work under DOT regulations, Resolve It Now employer required clinical substance abuse assessment should meet the requirements of your employer.\r\n\r\nHowever, please check with your employer prior to registering with us to be certain which type of assessment is needed.\r\n\r\nAll Resolve It Now assessors possess the credentials and qualifications to perform DOT evaluations.\r\n', 'DOT Substance Abuse Evaluation', '', 'publish', 'closed', 'closed', '', 'dot-substance-abuse-evaluation', '', '', '2018-12-29 00:36:01', '2018-12-29 00:36:01', '', 0, 'https://myphpdevelopers.com/dev/drugsandalcoholassessment/?post_type=drg_product&#038;p=37', 0, 'drg_product', '', 0),
(38, 1, '2018-11-24 17:32:08', '2018-11-24 17:32:08', 'Employer required drug & alcohol assessments apply to situations when the employee has violated company alcohol and/or drug policy in the workplace due to reasonable suspicion, an accident on the job, and in situations where the employer suspects an employee has a substance abuse related problem outside the workplace and might need help.\r\n\r\nOur clinical assessments evaluate the employees readiness to return to work and make specific clinical recommendations for treatment (if applicable). If treatment is recommended, we provide a time frame within which the employee and employer can expect the employee to return to work, assuming employees compliance.\r\n\r\nAll assessment determinations are made using American Psychiatric Association DSM-5 diagnostic criteria.\r\n\r\nYour assessment report is provided to you for your own purposes and it is at your discretion for whom you allow to review it.\r\n\r\nFor DOT (49 C.F.R.  40) SAP evaluations please see link for DOT Substance Abuse Evaluations\r\n\r\nCan be done via phone, webcam or in person depending on your location.\r\nCompleted 4-5 days after interview.\r\n', 'Employer Required Substance Abuse Assessment', '', 'publish', 'closed', 'closed', '', 'employer-required', '', '', '2018-12-29 00:35:37', '2018-12-29 00:35:37', '', 0, 'https://myphpdevelopers.com/dev/drugsandalcoholassessment/?post_type=drg_product&#038;p=38', 0, 'drg_product', '', 0),
(39, 1, '2018-11-24 17:32:26', '2018-11-24 17:32:26', 'Not all Driving under the Influence of Alcohol (DUI) or Drug (DUID) arrests mean the individual has a substance use related disorder. However, courts very often require a clinical substance abuse assessment. The DUI Alcohol and DUID drug assessment determines if any problem exists, the extent of the problem, and whether treatment, or alcohol and drug risk education classes are indicated for the individual.\r\n\r\nAll DUI alcohol and drug assessment determinations are made using American Psychiatric Association DSM-5 diagnostic criteria. Your assessment report is provided to you for your own purposes and it is at your discretion for whom you allow to review it.\r\n\r\n* If you have been charged with a DUI or OMVI for a substance other than alcohol please choose the General Drug and Alcohol Assessment.\r\n\r\nCan be done via phone, webcam or in person depending on your location.\r\nCompleted 4-5 days after Interview', 'DUI Alcohol/DUID Drug Assessment', '', 'publish', 'closed', 'closed', '', 'dui-alcohol-duid-drug-assessment', '', '', '2018-12-29 00:35:18', '2018-12-29 00:35:18', '', 0, 'https://myphpdevelopers.com/dev/drugsandalcoholassessment/?post_type=drg_product&#038;p=39', 0, 'drg_product', '', 0),
(40, 1, '2018-11-24 18:35:54', '2018-11-24 18:35:54', '<tbody>\r\n<tr>\r\n<td>Hi {%user_name%},</td>\r\n</tr>\r\n<tr>\r\n<td>\r\nWelcome to Drugs & Alcohol Assessment. Your account has been successfully created and activated. You can easily log in with your given credentials. Thank you.\r\n</td>\r\n</tr>\r\n</tbody>', 'Mail To User For Creating Account', '', 'publish', 'closed', 'closed', '', 'mail-to-user-for-creating-account', '', '', '2018-11-24 18:40:56', '2018-11-24 18:40:56', '', 0, 'https://myphpdevelopers.com/dev/drugsandalcoholassessment/?post_type=drg_mail_template&#038;p=40', 0, 'drg_mail_template', '', 0),
