(42, 1, '2018-11-24 18:46:19', '2018-11-24 18:46:19', '<tbody>\r\n<tr>\r\n<td>\r\nHello Administrator,<br>\r\n\r\nNew {%user_role%} joined at our website {%blog_name%}. Find brief details here -<br>\r\n</td>\r\n</tr>\r\n</tbody>\r\n\r\n<table>\r\n<thead>\r\n<th colspan=\"2\">User Details:</th>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td><strong>Name: </strong></td>\r\n<td>{%user_name%}</td>\r\n</tr>\r\n<tr>\r\n<td><strong>Email: </strong></td>\r\n<td>{%email%}</td>\r\n</tr>\r\n<tr>\r\n<td><strong>Contact No: </strong></td>\r\n<td>{%contact_no%}</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'Mail To Admin For User Registration', '', 'publish', 'closed', 'closed', '', 'mail-to-admin-for-user-registration', '', '', '2018-11-24 18:46:49', '2018-11-24 18:46:49', '', 0, 'https://myphpdevelopers.com/dev/drugsandalcoholassessment/?post_type=drg_mail_template&#038;p=42', 0, 'drg_mail_template', '', 0),
