(78, 1, '2018-12-20 18:24:04', '2018-12-20 18:24:04', 'I believe in creating a sense of partnership and collaboration and I am driven to help my clients to get the foundation, tools and love life to the fullest. I have 12 years of experience as a Substance Abuse Counselor, with expertise in clinical evaluations, treatment planning, referrals, detox support, and group counseling. I have extensive experience working with corrections and court mandated clients in conducting assessments, treatment and aftercare. I am a very compassionate worker towards clients needs. My best asset is to actively listen and provide encouragement and hope to my clients. Find joy in helping others especially those lost in addiction', 'Nelu Zia -MPA, MHA, LAADC, ICAADC, ICCS, SAP, MCA', '', 'publish', 'closed', 'closed', '', 'nelu-zia-mpa-mha-laadc-icaadc-iccs-sap-mca', '', '', '2018-12-20 18:24:04', '2018-12-20 18:24:04', '', 0, 'http://myphpdevelopers.com/dev/drugsandalcoholassesment/?post_type=drg_staff&#038;p=78', 0, 'drg_staff', '', 0),
