(80, 1, '2018-12-20 18:24:25', '2018-12-20 18:24:25', 'I have worked in the hospital psych ward, chemical dependency unit, private addiction clinics, Half Way\r\nHouse, Elementary School children and High School Students. At present working at Bay Area Addiction\r\nResearch Treatment (BAART)contracted via VA in Menlo Park, California. Hence, a third of our client\r\npopulation are veterans suffering from substance abuse along with co-occurring conditions such as\r\nPTSD, SMT, TBI, etc.', 'Amina Habib  MFT, CADACII', '', 'publish', 'closed', 'closed', '', 'amina-habib-mft-cadacii', '', '', '2018-12-28 20:59:03', '2018-12-28 20:59:03', '', 0, 'http://myphpdevelopers.com/dev/drugsandalcoholassesment/?post_type=drg_staff&#038;p=80', 0, 'drg_staff', '', 0),
