(102, 1, '2018-12-29 00:24:21', '2018-12-29 00:24:21', 'We provide clinical substance abuse assessments for United States citizens abroad who have encountered legal charges in other countries involving alcohol or illicit drug use in a variety of circumstances and situations.\n\nPlease contact us to discuss your situation and determine if we can help. All assessment determinations are made using American Psychiatric Association DSM-5 diagnostic criteria.\n\nYour assessment report is provided to you for your own purposes and it is at your discretion if you wish courts, legal, and/or medical professionals to review it.\n\nCan be done via Phone, Webcam or in person depending on your location.\n', 'International Substance Abuse Assessment', '', 'inherit', 'closed', 'closed', '', '35-autosave-v1', '', '', '2018-12-29 00:24:21', '2018-12-29 00:24:21', '', 35, 'http://46.101.255.67/Drugsandalcoholassesment/35-autosave-v1/', 0, 'revision', '', 0),
(103, 1, '2018-12-29 00:27:31', '2018-12-29 00:27:31', 'Employer required drug & alcohol assessments apply to situations when the employee has violated company alcohol and/or drug policy in the workplace due to reasonable suspicion, an accident on the job, and in situations where the employer suspects an employee has a substance abuse related problem outside the workplace and might need help.\n\nOur clinical assessments evaluate the employees readiness to return to work and make specific clinical recommendations for treatment (if applicable). If treatment is recommended, we provide a time frame within which the employee and employer can expect the employee to return to work, assuming employees compliance.\n\nAll assessment determinations are made using American Psychiatric Association DSM-5 diagnostic criteria.\n\nYour assessment report is provided to you for your own purposes and it is at your discretion for whom you allow to review it.\n\nFor DOT (49 C.F.R.  40) SAP evaluations please see link for DOT Substance Abuse Evaluations\n\nCan be done via phone, webcam or in person depending on your location.\nCompleted 4-5 days after interview.\n', 'Employer Required Substance Abuse Assessment', '', 'inherit', 'closed', 'closed', '', '38-autosave-v1', '', '', '2018-12-29 00:27:31', '2018-12-29 00:27:31', '', 38, 'http://46.101.255.67/Drugsandalcoholassesment/38-autosave-v1/', 0, 'revision', '', 0),
(104, 1, '2018-12-29 00:29:33', '2018-12-29 00:29:33', 'General clinical drug and substance abuse assessments apply to situations involving an individuals use of alcohol, illicit drugs, and prescription medications. A general clinical drug abuse assessment is requested by self-referral, someone close to you who is concerned about your use of substances, or recommended by your physician or other healthcare provider.\r\n\r\nAll assessment determinations are made using American Psychiatric Association DSM-5 diagnostic criteria. Your assessment report is provided to you for your own purposes and it is at your discretion for whom you allow to review it.\r\n\r\nCan be done via phone, webcam or in person depending on your location.\r\nCompleted 4-5 days after interview.', 'General Substance Abuse Assessment', '', 'publish', 'closed', 'closed', '', 'general-substance-abuse-assessment', '', '', '2018-12-29 00:31:44', '2018-12-29 00:31:44', '', 0, 'http://46.101.255.67/Drugsandalcoholassesment/?post_type=drg_product&#038;p=104', 0, 'drg_product', '', 0),
