(110, 1, '2018-12-29 09:36:58', '2018-12-29 09:36:58', '<tbody>\r\n<tr>\r\n<td>\r\nHello {%user_name%},<br>\r\nYou have assigned as a counselor for having an interview with {%customer%}. Please check details below -\r\n</td>\r\n</tr>\r\n</tbody>\r\n\r\n<table>\r\n<thead>\r\n<th colspan=\"2\">Assessment Schedule Details:</th>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td><strong>Assessment Title: </strong></td>\r\n<td>{%title%}</td>\r\n</tr>\r\n<tr>\r\n<td><strong>Customer: </strong></td>\r\n<td>{%customer%}</td>\r\n</tr>\r\n<tr>\r\n<td><strong>Customer Contact No: </strong></td>\r\n<td>{%customer_contact_no%}</td>\r\n</tr>\r\n<tr>\r\n<td><strong>Date & Time: </strong></td>\r\n<td>{%date_time%}</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'Mail To Counselor For Assigning Customer For Assessment', '', 'publish', 'closed', 'closed', '', 'mail-to-counselor-for-assigning-customer-for-assessment', '', '', '2018-12-29 11:41:38', '2018-12-29 11:41:38', '', 0, 'http://46.101.255.67/Drugsandalcoholassesment/?post_type=drg_mail_template&#038;p=110', 0, 'drg_mail_template', '', 0),
(111, 1, '2018-12-29 19:33:43', '2018-12-29 19:33:43', '<span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Resolve It Now Assessments was formed with the mission to set the gold standard in online clinical substance abuse assessments and evaluation.</span></span></span>\r\n\r\n<span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">We provide our substance and alcohol assessment services online, and when appropriate, in person to individuals, employers, attorneys, judicial entities, correction systems, professional licensing boards, and consultation within the corporate sector addressing a variety of circumstances and situations:</span></span></span>\r\n<ul>\r\n 	<li><span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Legal Charges for DUI and/or Possession of Controlled Substances</span></span></span></li>\r\n 	<li><span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Drivers License Reinstatement</span></span></span></li>\r\n 	<li><span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Department of Transportation Evaluations</span></span></span></li>\r\n 	<li><span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Family Court (Divorce and Child Custody)</span></span></span></li>\r\n 	<li><span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Professional Licensing Boards (Health Care, Legal, etc.)</span></span></span></li>\r\n 	<li><span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Individuals and/or families with substance abuse related concerns</span></span></span></li>\r\n</ul>\r\n<span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Resolve It Now Assessments operates on a set of values and ethical practices that ensure our clinical assessments and evaluations are of highest quality to meet the requirements of all our clients. We provide our clients with services that are convenient, save time, and maintain privacy, doing so at an affordable rate maximizing the use of online technology. We assure professional, competent, and courteous customer care to all our clients.</span></span></span>\r\n\r\n<span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Our drug and alcohol assessments feature the use of standard and proprietary diagnostic screening tools to rule-out bias and achieve accuracy. All diagnostic determinations are made utilizing American Psychiatric Association DSM-5 criteria. Clinical recommendations for treatment (if appropriate) are indicated on the assessment report.</span></span></span>\r\n\r\n&nbsp;\r\n\r\n<span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Clients choose us and professionals refer to us because:</span></span></span>\r\n<ol>\r\n 	<li><span style=\"color: #000000;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Choose the Assessment You Need</span></span></span></li>\r\n 	<li><span style=\"color: #000000;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Register and purchase with Resolve It Now Assessments</span></span></span></li>\r\n 	<li><span style=\"color: #000000;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Follow the Link You Receive via Email</span></span></span></li>\r\n 	<li><span style=\"color: #000000;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Fill out a short Initial Inventory</span></span></span></li>\r\n 	<li><span style=\"color: #000000;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Set Appointment time with Assessor</span></span></span></li>\r\n 	<li><span style=\"color: #000000;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Complete Interview via Webcam or Phone</span></span></span></li>\r\n</ol>\r\n<span style=\"color: #000000;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">For Help Contact Us Anytime 24/7</span></span></span>', 'About Us', '', 'inherit', 'closed', 'closed', '', '18-revision-v1', '', '', '2018-12-29 19:33:43', '2018-12-29 19:33:43', '', 18, 'http://46.101.255.67/Drugsandalcoholassesment/18-revision-v1/', 0, 'revision', '', 0),
(112, 1, '2018-12-29 19:33:57', '2018-12-29 19:33:57', '<ul>\r\n 	<li><span style=\"color: #000000;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">GENERAL SUBSTANCE ABUSE ASSESSMENT</span></span></span></li>\r\n 	<li><span style=\"color: #000000;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">DUI ALCOHOL/DUID DRUG ASSESSMENT</span></span></span></li>\r\n 	<li><span style=\"color: #000000;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">EMPLOYER REQUIRED SUBSTANCE ABUSE ASSESSMENT</span></span></span></li>\r\n 	<li><span style=\"color: #000000;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">DOT SUBSTANCE ABUSE EVALUATION</span></span></span></li>\r\n 	<li><span style=\"color: #000000;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">CHILD CUSTODY/DIVORCE SUBSTANCE ABUSE ASSESSEMENT</span></span></span></li>\r\n 	<li><span style=\"color: #000000;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">INTERNATIONAL SUBSTANCE ABUSE ASSESSMENT</span></span></span></li>\r\n</ul>\r\n<h2 class=\"western\"><span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: x-large;\"><b>How Assessments Work</b></span></span></span></h2>\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\">Our service objective is to help you obtain your assessment result and report in a professional yet efficient manner  online and with little or no email, faxing or paperwork. Below are the 5 steps to our assessment process and the time typically required to complete each one. Completion times vary according to assessment type and your ability to complete each step in a timely way. As you move through this process a green checkmark progress bar will visually guide you through each step until all steps are completed.</span></span></span></span>\r\n<ol>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\">Register, Purchase Service and Complete Initial Inventory. Time to complete this portion varies from 10-25 minutes.</span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\">Complete a Video Conference or Phone Interview  email, call, or use your account dashboard to request a time to talk to an evaluator. This is typically scheduled within 24-48 hours and requires 40-50 minutes of actual interview time. If you have never done a videoconference before, we will be glad to help you with the simple setup process.</span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\">Email, Fax, or Upload necessary documentation  If you are seeking an evaluation to reinstate your license with a DMV or BMV we may need to review additional documents from your state to be compliant with state requirements.\r\nWait for Your Evaluator to Post Your Report  Once the report is ready you may view/download/print your report and send it to the person of your choice.</span></span></span></span>\r\n<ul>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\">Evaluators post reports within 24 hours of completion of the previous steps. Reports are addressed to the party of your choice.</span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\">Some assessments for a drivers license reinstatement add more steps depending on the requirements of the state. For example, some states require supporting information from third parties for a complete evaluation.</span></span></span></span></li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\">If you need any technical support as you go through the process just email us at</span></span><span style=\"color: #0000ff;\"><u><a href=\"mailto:support@oaktree.com\" target=\"_blank\" rel=\"noopener\"><span style=\"color: #1155cc;\"><span style=\"font-family: Arial, serif;\">ENTER</span></span></a></u></span><span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\"> EMAILor callENTER NUMBER</span></span></span></span>', 'Assessments', '', 'inherit', 'closed', 'closed', '', '14-revision-v1', '', '', '2018-12-29 19:33:57', '2018-12-29 19:33:57', '', 14, 'http://46.101.255.67/Drugsandalcoholassesment/14-revision-v1/', 0, 'revision', '', 0),
(113, 1, '2018-12-29 19:34:25', '2018-12-29 19:34:25', '<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\">INFORMATION FOR LEGAL ENTITIES</span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\">Resolve It Now Assessments provides clinical substance abuse assessments and evaluation for Courts, Judges, Corrections System, Probation Officers, Drug Diversion, Forensic Assessments, Attorneys, DMV, BMV, and Family Court (Child Custody/Divorce).</span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\">Our assessments feature the use of standard and proprietary diagnostic screening tools to rule-out bias and achieve accuracy. All diagnostic determinations are made utilizing American Psychiatric Association DSM-5 criteria. Clinical recommendations for treatment (if appropriate) are indicated on the assessment report. Extensive and extended, reporting and consultation is available to third party collateral contacts when requested.</span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\">Requests for Client Records &amp; Proof Of Compliance</span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\">Probation officers seeking information regarding client records may scan and email signed client consent to release information to ENTER EMAIL</span></span></span></span>\r\n\r\n<span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Resolve It Now provides clinical substance abuse assessments and evaluation to employees who have violated drug or alcohol related work policy, including healthcare professionals, law enforcement, corporate executives, and those in violation of the Department of Transportation Federal Drug and Alcohol Testing rules (49 C.F.R.  40).</span></span></span>\r\n\r\n<span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Our clinical alcohol assessments evaluate the employees readiness to return to work and make specific clinical recommendations for treatment (if applicable). If treatment is recommended, we provide a time frame within which the employee and employer can expect the employee to return to work, assuming employees compliance.</span></span></span>\r\n\r\n<span style=\"color: #222222;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">All assessment determinations are made using American Psychiatric Association DSM-5 diagnostic criteria.</span></span></span>', 'Courts', '', 'inherit', 'closed', 'closed', '', '16-revision-v1', '', '', '2018-12-29 19:34:25', '2018-12-29 19:34:25', '', 16, 'http://46.101.255.67/Drugsandalcoholassesment/16-revision-v1/', 0, 'revision', '', 0),
