(117, 1, '2018-12-31 12:18:57', '2018-12-31 12:18:57', '<ul>\r\n 	<li><span style=\"color: #000000;\"><span style=\"font-size: medium;\">GENERAL SUBSTANCE ABUSE ASSESSMENT</span></span></li>\r\n 	<li><span style=\"color: #000000;\"><span ><span style=\"font-size: medium;\">DUI ALCOHOL/DUID DRUG ASSESSMENT</span></span></span></li>\r\n 	<li><span style=\"color: #000000;\"><span ><span style=\"font-size: medium;\">EMPLOYER REQUIRED SUBSTANCE ABUSE ASSESSMENT</span></span></span></li>\r\n 	<li><span style=\"color: #000000;\"><span><span style=\"font-size: medium;\">DOT SUBSTANCE ABUSE EVALUATION</span></span></span></li>\r\n 	<li><span style=\"color: #000000;\"><span><span style=\"font-size: medium;\">CHILD CUSTODY/DIVORCE SUBSTANCE ABUSE ASSESSEMENT</span></span></span></li>\r\n 	<li><span style=\"color: #000000;\"><span><span style=\"font-size: medium;\">INTERNATIONAL SUBSTANCE ABUSE ASSESSMENT</span></span></span></li>\r\n</ul>\r\n<h2 class=\"western\"><span style=\"color: #222222;\"><span><span style=\"font-size: x-large;\"><b>How Assessments Work</b></span></span></span></h2>\r\n<span><span><span style=\"color: #222222;\"><span>Our service objective is to help you obtain your assessment result and report in a professional yet efficient manner  online and with little or no email, faxing or paperwork. Below are the 5 steps to our assessment process and the time typically required to complete each one. Completion times vary according to assessment type and your ability to complete each step in a timely way. As you move through this process a green checkmark progress bar will visually guide you through each step until all steps are completed.</span></span></span></span>\r\n<ol>\r\n 	<li><span><span style=\"font-size: medium;\"><span style=\"color: #222222;\"><span >Register, Purchase Service and Complete Initial Inventory. Time to complete this portion varies from 10-25 minutes.</span></span></span></span></li>\r\n 	<li><span><span style=\"font-size: medium;\"><span s