(119, 1, '2018-12-31 12:21:50', '2018-12-31 12:21:50', '<span><span style=\"font-size: medium;\"><b><span style=\"color: #222222;\"><span>INFORMATION FOR LEGAL ENTITIES</span></span></b></span></span>\r\n\r\n<span ><span style=\"font-size: medium;\"><span style=\"color: #222222;\"><span>Resolve It Now Assessments provides clinical substance abuse assessments and evaluation for Courts, Judges, Corrections System, Probation Officers, Drug Diversion, Forensic Assessments, Attorneys, DMV, BMV, and Family Court (Child Custody/Divorce).</span></span></span></span>\r\n\r\n<span ><span style=\"font-size: medium;\"><span style=\"color: #222222;\"><span >Our assessments feature the use of standard and proprietary diagnostic screening tools to rule-out bias and achieve accuracy. All diagnostic determinations are made utilizing American Psychiatric Association DSM-5 criteria. Clinical recommendations for treatment (if appropriate) are indicated on the assessment report. Extensive and extended, reporting and consultation is available to third party collateral contacts when requested.</span></span></span></span>\r\n\r\n<span ><span style=\"font-size: medium;\"><span style=\"color: #222222;\"><span >Requests for Client Records &amp; Proof Of Compliance</span></span></span></span>\r\n\r\n<span ><span style=\"font-size: medium;\"><span style=\"color: #222222;\"><span>Probation officers seeking information regarding client records may scan and email signed client consent to release information to ENTER EMAIL</span></span></span></span>\r\n\r\n<span style=\"color: #222222;\"><span><span style=\"font-size: medium;\">Resolve It Now provides clinical substance abuse assessments and evaluation to employees who have violated drug or alcohol related work policy, including healthcare professionals, law enforcement, corporate executives, and those in violation of the Department of Transportation Federal Drug and Alcohol Testing rules (49 C.F.R.  40).</span></span></span>\r\n\r\n<span style=\"color: #222222;\"><span><span style=\"font-size: medium;\">Our clinical alcohol assessments evaluate the employees readiness to return to work and make specific clinical recommendations for treatment (if applicable). If treatment is recommended, we provide a time frame within which the employee and employer can expect the employee to return to work, assuming employees compliance.</span></span></span>\r\n\r\n<span style=\"color: #222222;\"><span><span style=\"font-size: medium;\">All assessment determinations are made using American Psychiatric Association DSM-5 diagnostic criteria.</span></span></span>', 'Courts', '', 'inherit', 'closed', 'closed', '', '16-revision-v1', '', '', '2018-12-31 12:21:50', '2018-12-31 12:21:50', '', 16, 'http://46.101.255.67/Drugsandalcoholassesment/16-revision-v1/', 0, 'revision', '', 0),
(120, 1, '2018-12-31 12:25:20', '2018-12-31 12:25:20', '<span style=\"color: #222222;\"><span><span style=\"font-size: medium;\">Resolve It Now Assessments was formed with the mission to set the gold standard in online clinical substance abuse assessments and evaluation.</span></span></span>\n\n<span style=\"color: #222222;\"><span><span style=\"font-size: medium;\">We provide our substance and alcohol assessment services online, and when appropriate, in person to individuals, employers, attorneys, judicial entities, correction systems, professional licensing boards, and consultation within the corporate sector addressing a variety of circumstances and situations:</span></span></span>\n<ul>\n 	<li><span style=\"color: #222222;\"><span><span style=\"font-size: medium;\">Legal Charges for DUI and/or Possession of Controlled Substances</span></span></span></li>\n 	<li><span style=\"color: #222222;\"><span><span style=\"font-size: medium;\">Drivers License Reinstatement</span></span></span></li>\n 	<li><span style=\"color: #222222;\"><span><span style=\"font-size: medium;\">Department of Transportation Evaluations</span></span></span></li>\n 	<li><span style=\"color: #222222;\"><span><span style=\"font-size: medium;\">Family Court (Divorce and Child Custody)</span></span></span></li>\n 	<li><span style=\"color: #222222;\"><span><span style=\"font-size: medium;\">Professional Licensing Boards (Health Care, Legal, etc.)</span></span></span></li>\n 	<li><span style=\"color: #222222;\"><span><span style=\"font-size: medium;\">Individuals and/or families with substance abuse related concerns</span></span></span></li>\n</ul>\n<span style=\"color: #222222;\"><span><span style=\"font-size: medium;\">Resolve It Now Assessments operates on a set of values and ethical practices that ensure our clinical assessments and evaluations are of highest quality to meet the requirements of all our clients. We provide our clients with services that are convenient, save time, and maintain privacy, doing so at an affordable rate maximizing the use of online technology. We assure professional, competent, and courteous customer care to all our clients.</span></span></span>\n\n<span style=\"color: #222222;\"><span><span style=\"font-size: medium;\">Our drug and alcohol assessments feature the use of standard and proprietary diagnostic screening tools to rule-out bias and achieve accuracy. All diagnostic determinations are made utilizing American Psychiatric Association DSM-5 criteria. Clinical recommendations for treatment (if appropriate) are indicated on the assessment report.</span></span></span>\n\n&nbsp;\n\n<span style=\"color: #222222;\"><span><span style=\"font-size: medium;\">Clients choose us and professionals refer to us because:</span></span></span>\n<ol>\n 	<li><span style=\"color: #000000;\"><span><span style=\"font-size: medium;\">Choose the Assessment You Need</span></span></span></li>\n 	<li><span style=\"color: #000000;\"><span><span style=\"font-size: medium;\">Register and purchase with Resolve It Now Assessments</span></span></span></li>\n 	<li><span style=\"color: #000000;\"><span><span style=\"font-size: medium;\">Follow the Link You Receive via Email</span></span></span></li>\n 	<li><span style=\"color: #000000;\"><span><span style=\"font-size: medium;\">Fill out a short Initial Inventory</span></span></span></li>\n 	<li><span style=\"color: #000000;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Set Appointment time with Assessor</span></span></span></li>\n 	<li><span style=\"color: #000000;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">Complete Interview via Webcam or Phone</span></span></span></li>\n</ol>\n<span style=\"color: #000000;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: medium;\">For Help Contact Us Anytime 24/7</span></span></span>', 'About Us', '', 'inherit', 'closed', 'closed', '', '18-autosave-v1', '', '', '2018-12-31 12:25:20', '2018-12-31 12:25:20', '', 18, 'http://46.101.255.67/Drugsandalcoholassesment/18-autosave-v1/', 0, 'revision', '', 0),
