(126, 1, '2018-12-31 21:24:14', '2018-12-31 21:24:14', '&nbsp;\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Consent for Service, Limits and Terms of Use Agreement</span></span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Anyone registering, paying, and choosing to use Resolve It Now Drugs and Alcohol Assessments agrees to the following Consent for Service, Limits and Terms of Use:</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Company Name / Client Reference Hereafter</span></span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS is an assessment service established in the state of California. The term \"RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS\" refers the website (www.drugsandalcoholassessment.com), directors, officers, agents, employees, successors and assigns. Hereafter, registered users of the RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS.com website shall be referred to as \"you/your\", \"client\" or \"the client\".</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Adults/Minors Requesting Service</span></span></span></b></span></span>\r\n\r\n<a name=\"_GoBack\"></a> <span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">You agree that you are 18 years old or older, and if you are not, you will have a parent or guardian establish the registration, payment and Consent for Service and Terms of Use Agreement on your behalf. However, minors using our service to obtain an assessment, agree to complete the online questionnaire portion of the assessment without the assistance of parent, guardian or any other third parties.</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Solo Participation &amp; False Identity</span></span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">You agree to answer questions and questionnaires without the presence or assistance of any third party and agree not to have any third party present at an in-person, telephone or video/webcam interview without first making a direct request to RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS and stating the reason that you wish for a third party to be present. RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS has the right to deny any such requests if they deem them inappropriate for any reason. You explicitly agree to not have another party stand in as your representative or falsely present themselves in an interview using your identity.</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Online Service Limitations</span></span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS provides online services. You understand that use of online services may not be an appropriate form of care for persons in an emotional or mental health crisis. We reserve the right to assess your situation and decline to offer you services if we believe it is not in your best interests to do so. </span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Consent for Assessment</span></span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">You understand and consent to an assessment provided by a professional counselor from RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS. RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS services are provided by certified and/or licensed mental health practitioners. </span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">General Information Security Practices</span></span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS recognizes the absolute importance of keeping client records private and confidential. This section of the Agreement includes our general security practices to keep your information private:</span></span></span></span></span>\r\n<ul>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">all records are stored on SSL encrypted servers</span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">paper records/documents related to your service are kept in locked cabinets</span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">account passwords are set to health industry standards to include appropriate length and sufficient variation in characters to minimize chances of access by any third party</span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">sessions conducted via webcam/video are not recorded by RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS</span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS does not sell your email or other personal contact information to any parties</span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Occasionally for training and supervision purposes we may request that you allow an audio recording of your clinical interview. You are free to decline such requests and any recordings agreed to will be destroyed within 30 days of the recording</span></span></span></span></span></li>\r\n</ul>\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Limits to Confidentiality and Privacy</span></span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Privacy and confidentiality are not only important to have a trusted exchange of client/ clinician information, but they are also items subject to federal law. RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS complies with federal confidentiality guidelines under Federal Confidentiality regulations (42 CFR Part 2) and the Health Insurance Portability and Accountability Act (HIPAA 45 CFR). This protection of confidentiality also specifically (42/Part 2) protects the records of mental health, alcohol and drug abuse patients, including the prohibition of re-disclosure of information from client/patient records. HIPAA also requires that mental health and substance abuse professionals provide notice to all clients that information provided by RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS and voluntarily disclosed to third parties by you (to courts, probation officers, physicians, schools, etc.) may be re-disclosed by these third parties. </span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Furthermore, in compliance with the aforementioned federal laws, RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS has the obligation to limit client/customer confidentiality and report specific information in the following circumstances:</span></span></span></span></span>\r\n<ul>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS is mandated to report suspected or known abuse of children and vulnerable adults to local law enforcement and/or local child/adult protective agencies.</span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS is mandated to report specific information to local law enforcement in situations where a client is at significant risk for taking their own life or the life (or lives) of another (others). RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS will make a concerted effort to assist clients in accessing appropriate professional care in such circumstances.</span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS is obligated to release your records for legal proceedings if ordered by a court to do so.</span></span></span></span></span></li>\r\n</ul>\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS uses security encrypted (SSL) transmission for all professional assessment services completed online. If you choose a webcam/video/telephone service, including uploading, downloading, or faxing personal information to or from RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS, you should be aware that risk of interception of your information, though unlikely, is a possibility. RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS client records are stored on encrypted secure servers or in secure facilities where access is limited to the professional evaluator assigned to the client and their clinical supervisors. Identifying names are not used by the evaluator if discussing client circumstances with a professional supervisor.</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">There is also no express or implied warranty for any client losses, damage or harm occurring from the use of electronic services, which would include: unauthorized data interception or data/records theft by a third party, unintended utility charges by a third party, computer/electronic viruses, accidental deletion of data or records, or any other claim of harm arising from your choice to engage RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS services using electronic means (telephone, fax, internet, wireless, email, video/webcam or any other electronic delivery services that might be used in the future).</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Responsibility for Transfer of Your Records to Requesting Parties</span></span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">You understand that RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS will place an official document or report signed by a credentialed professional in your online account with RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS. As noted elsewhere in this document you are responsible to review the document in its entirety before releasing it to any person or company. You may provide the official document to any requesting party at any time (e.g. court, probation officer, attorney, employer, etc.)</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Delivery Timeframes</span></span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Standard report deliveries are within 5 business days of the time of your clinical interview. The report will be delivered to your account by the end of the appropriate business day (5pm) in your time zone. Your account with us will include a time stamp showing the date and time your report is posted.</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Rush Order timeframes are defined as follows:\r\nSame business day delivery  by 5pm in your time zone on the day of your clinical interview. If ordering an assessment near the end of the business day you may be required to pay a same-day rush order fee in order to have the report ready by a morning deadline of 8am or 9am.</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Next business day delivery  by 5pm in your time zone on the next business day after your clinical interview</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Two to three business day delivery  by 5pm in your time zone on the third business day after your clinical interview</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Saturday, Sunday, evenings and holidays are not considered business days and services rendered during such times may be quoted with additional convenience fees determined at the time you contact us for an assessment.</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Note: if you need your rushed report earlier than 5pm on the due date please let us know by phone and document this agreement for your records by email exchange with our administrative staff or your evaluator.</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Financial Responsibility &amp; Fees</span></span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">You understand that payment for service is due before receiving services from RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS. Additionally, you understand that RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS has no contractual obligation with your insurance company or yourself that would guarantee reimbursement for expenses you incur for any and all services provided by RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS.</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">You also understand that fees for services are posted on our website except in certain cases where fees are dependent on time demands of your case (e.g. in depth assessments for child custody, FAA assessments, ILC evaluations, some license reinstatement assessments, or other services which are determined and mutually agreed upon at the time of the service request).</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Client Cancellation Policy and Broken Appointment Fees</span></span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">You understand and agree that a fee will be charged to your account if you cancel your interview or appointment with less than 24 hours notice. You also understand and agree that RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS reserves the right to cancel your service and refund your payments minus any broken appointment fees if you cancel 2 or more scheduled interview or appointment times with less than 24 hours notice. Broken appointment fees are $50.00 per appointment and are charged to partially offset the loss of revenue which occurs when a time has been reserved for a client but which can no longer be booked due to the short notice in cancellation.</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Client Will Accurately Report Information</span></span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">As a client, you agree to provide accurate information about yourself and the circumstances surrounding your need for an evaluation to the best of your ability. This includes an agreement to not omit information relevant to your situation or present inaccurate information. If inaccurate information is provided or important information is purposely omitted, you will not be eligible for a refund if your assessment is not accepted.</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS is not a Government Entity</span></span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">You understand that RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS is not a state or federal organization. While our assessments and clinical reports are generally accepted by other professionals and government agencies you also understand that any clinical conclusions, diagnoses or professional recommendations provided by RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS may or may not be accepted or approved by courts, state or federal agencies. Furthermore, courts, state and federal agencies are not bound to agree with our assessments or clinical recommendations.</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Refund Terms &amp; Limitations</span></span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">You understand and agree with our conditions and limits to grant a refund. Refunds are only given in circumstances where the requesting party (court, physician, probation department, etc.) will not accept the assessment we provided and the following procedures are followed:</span></span></span></span></span>\r\n<ul>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">All refund requests must be initiated through your Resolve It Now Drug and Alcohol Assessments.com account by clicking on my transactions and refund requests in your account dashboard</span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">All refund requests must be applied for within 45 days of your original registration.</span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS will first attempt to contact any third party that does not accept your assessment to see if there is some additional information needed in order to gain acceptance of your report or service. In this circumstance you will need to first sign and return (fax or scan/email) a release of information form to allow your evaluator to speak with the third party.</span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">If we cannot make contact with the requesting party, you must provide written proof that your evaluation was not accepted by the requesting party. The document stating your assessment was not accepted must be on the letterhead of the requesting party and have an address, phone number and contact name included on it.</span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Refunds are not granted in situations where:</span></span></span></span></span>\r\n<ul>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">client omitted key information or;</span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">client provided inaccurate information or;</span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">client missed an assessment completion deadline because:\r\na) RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS was not informed of the due date,\r\nb) client did not meet with the evaluator at the originally scheduled time,\r\nc) client did not provide RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS evaluator with necessary documents\r\nrequested by evaluator or required to be reviewed by the authority\r\nrequesting the assessment</span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">clients assessment was approved initially approved in the original context but not acceptable in another context (Note for example: assessments for court are not guaranteed to be accepted by State Licensing or Motor Vehicle agencies and vice-versa)</span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">client purchased a rush order and report was completed within the timeframe that was ordered (evaluation fee and rush fee are both non-refundable) </span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">all assessments used in context of child custody proceedings are non-refundable (due to the contentious nature of child custody proceedings)</span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">all assessments used to apply for a license reinstatement are non-refundable</span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">all assessments related to safety-sensitive employment are non-refundable services (e.g. aviation/FAA substance abuse evaluations, DOT evaluations, nursing or other medical boards)</span></span></span></span></span></li>\r\n</ul>\r\n</li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">we do not refund assessments in situations where you might obtain a new assessment before we have been given the opportunity to seek approval of the assessment we provided</span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">If a refund is granted according to our terms and conditions, it will be processed within 15-30 days of the decision date.</span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">If you have obtained a new assessment RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS is not responsible for fees for your new assessment. Getting a new assessment or second opinion is not a valid reason to request a refund from RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS.</span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">If your appeal for a refund involves a claim that another assessment was immediately required you agree to submit copies of any such subsequent assessment(s) for consideration of your case.</span></span></span></span></span></li>\r\n</ul>\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">If you have purchased an assessment but do not complete the assessment process you will be refunded under the following conditions and limitations:</span></span></span></span></span>\r\n<ul>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Any rush order portion of your fees are not refunded since RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS dedicates clinician time for you which they cannot use to perform other assessments</span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">If you have purchased an assessment but not scheduled an interview your account will be charged a $25 administrative fee and the remainder of your funds will be refunded (excluding any applicable rush fees)</span></span></span></span></span></li>\r\n 	<li><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">If you have scheduled an interview and do not keep the appointed time your account will be charged a $50 no-show and the remainder of your funds will be refunded (excluding any applicable rush fees)</span></span></span></span></span></li>\r\n</ul>\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Limits of Electronic Connections and Liability</span></span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">You understand that there is a chance that internet or phone connection could be lost during your services. In the event your connection is lost, the counselor will attempt to contact you at the number you provided in your registration. If you have not heard from your counselor within five minutes, you agree to call our main number to reestablish connection and plan for continuance of your service. You also agree to hold RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS harmless with regard to any and all claims of damage from an electronic disconnection during services (also referred to in the Hold Harmless section of this agreement).</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Limited Use of Assessments</span></span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">You understand and agree that professional assessments prepared for one authority (e.g. a court, a licensing agency, a child services agency, etc.) may not be accepted by another authority. For example, a state licensing agency may require a different reporting format, provider credentials, etc. than a court, therefore making a court assessment unacceptable to their agency. Accordingly, you agree to accurately represent to Resolve It Now Drug and Alcohol Assessments.com what authority is requesting your assessment. (see refund terms and conditions) Furthermore you understand and agree that each requesting authority has their own acceptable timeframe to consider an assessment as valid. RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS cannot be held responsible for your submission of an assessment to an authority after what the requesting authority considers a reasonable timeframe.</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Respect of Copyrights</span></span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">All assessment, evaluation, educational and other material made available on our website and provided in our offices is copyrighted. You may use our materials for the purpose of a RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS assessment. You agree not to use any aforementioned RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS materials in any other manner, including copying, reproducing, scanning, distributing, publishing, selling or otherwise conducting commercial activity with RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS materials. Efforts to engage in such activity are punishable by state and federal laws.</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">No Guarantees of Clinical Outcome</span></span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">You agree that you are using RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS services at your own risk; that there is no warranty for our services; that third parties are not bound by any contracts or laws to accept or agree with our assessment, evaluation or other clinical conclusions.</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Complaints</span></span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">To file a complaint with us, contact the Director of the practice at: </span></span></span><a href=\"mailto:info@drugsandalcoholassessment.com\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">info@drugsandalcoholassessment.com</span></span></a></span></span>\r\n\r\nYou will not be retaliated against for filing a complaint.\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Acknowledgement of Receipt of Notice of Privacy Practices (HIPAA)</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">I acknowledge my receipt of Resolve It Now privacy practices</span></span></span><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">(revised and effective December 30, 2018) . It is included not only in this Consent for Service Agreement but is also available on our website and in our office for any client to access at any time.</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">---------------------------------------------------------------------------------------------------------------------</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Disputes and Jurisdiction</span></span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Any dispute arising from this Consent for Treatment and Terms of Use Agreement shall be governed by the laws and jurisdiction of the State of California.</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Notice of Changes</span></span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS may notify clients of changes or additions to its services by publishing such notice on the RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS website. Clients may give notice to RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS at any time by any of the following:\r\nEmail: </span></span></span><a href=\"mailto:info@drugsandalcoholassessment.com\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">info@drugsandalcoholassessment.com</span></span></a><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">\r\n</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><b><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">Modifications / Entire Agreement</span></span></span></b></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">This Agreement constitutes the entire agreement between you, the client, and RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS. The content represented herein supersedes all previous written or verbal terms of use agreements. RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS may amend, modify, clarify, or remove any part of this agreement with notice through the Resolve It Now Drug and Alcohol Assessments.com website. Any use of RESOLVE IT NOW DRUG AND ALCOHOL ASSESSMENTS services by you after any amendments, modifications, clarifications, or deletions shall be deemed to constitute acceptance by you of the updated terms of the agreement. You understand that if a court deems any part of this agreement to be illegal or a violation of California statutes, the remaining parts of the agreement shall be considered valid and enforceable until proven otherwise in a California court of law.</span></span></span></span></span>\r\n\r\n<span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: medium;\"><span style=\"color: #333333;\"><span style=\"font-family: Raleway, serif;\"><span lang=\"en\">By signing in person or clicking on the \"agree\" button below this Consent for Service, this Limits and Terms of Use Agreement shall be construed and controlled by the applicable laws of the state of California and the United States of America.</span></span></span></span></span>\r\n\r\n&nbsp;', 'Terms & Conditions', '', 'inherit', 'closed', 'closed', '', '122-revision-v1', '', '', '2018-12-31 21:24:14', '2018-12-31 21:24:14', '', 122, 'http://46.101.255.67/Drugsandalcoholassesment/122-revision-v1/', 0, 'revision', '', 0),
