stance abuse assessments and evaluation to employees who have violated drug or alcohol related work policy, including healthcare professionals, law enforcement, corporate executives, and those in violation of the Department of Transportation Federal Drug and Alcohol Testing rules (49 C.F.R.  40).</span></span></span>\r\n\r\n<span style=\"color: #222222;\"><span><span style=\"font-size: medium;\">Our clinical alcohol assessments evaluate the employees readiness to return to work and make specific clinical recommendations for treatment (if applicable). If treatment is recommended, we provide a time frame within which the employee and employer can expect the employee to return to work, assuming employees compliance.</span></span></span>\r\n\r\n<span style=\"color: #222222;\"><span><span style=\"font-size: medium;\">All assessment determinations are made using American Psychiatric Association DSM-5 diagnostic criteria.</span></span></span>', 'Courts', '', 'inherit', 'closed', 'closed', '', '16-revision-v1', '', '', '2019-01-09 12:20:37', '2019-01-09 12:20:37', '', 16, 'http://46.101.255.67/Drugsandalcoholassesment/16-revision-v1/', 0, 'revision', '', 0),
(145, 1, '2019-01-09 12:21:09', '2019-01-09 12:21:09', '<ul>\r\n 	<li><span style=\"color: #000000;\"><span style=\"font-size: medium;\">GENERAL SUBSTANCE ABUSE ASSESSMENT</span></span></li>\r\n 	<li><span style=\"color: #000000;\"><span ><span style=\"font-size: medium;\">DUI ALCOHOL/DUID DRUG ASSESSMENT</span></span></span></li>\r\n 	<li><span style=\"color: #000000;\"><span ><span style=\"font-size: medium;\">EMPLOYER REQUIRED SUBSTANCE ABUSE ASSESSMENT</span></span></span></li>\r\n 	<li><span style=\"color: #000000;\"><span><span style=\"font-size: medium;\">DOT SUBSTANCE ABUSE EVALUATION</span></span></span></li>\r\n 	<li><span style=\"color: #000000;\"><span><span style=\"font-size: medium;\">CHILD CUSTODY/DIVORCE SUBSTANCE ABUSE ASSESSEMENT</span></span></span></li>\r\n 	<li><span style=\"color: #000000;\"><span><span style=\"font-size: medium;\">INTERNATIONAL SUBSTANCE ABUSE ASSESSMENT</span></span></span></li>\r\n</ul>\r\n<h2 class=\"western\"><span style=\"color: #222222;\"><span><span style=\"font-size: x-large;\"><b>How Assessments Work</b></span></span></span></h2>\r\n<span><span><span style=\"color: #222222;\"><span>Our service objective is to help you obtain your assessment result and report in a professional yet efficient manner  online and with little or no email, faxing or paperwork. Below are the 5 steps to our assessment process and the time typically required to complete each one. Completion times vary according to assessment type and your ability to complete each step in a timely way. As you move through this process a green checkmark progress bar will visually guide you through each step until all steps are completed.</span></span></span></span>\r\n<ol>\r\n 	<li><span><span style=\"font-size: medium;\"><span style=\"color: #222222;\"><span >Register, Purchase Service and Complete Initial Inventory. Time to complete this portion varies from 10-25 minutes.</span></span></span></span></li>\r\n 	<li><span><span style=\"font-size: medium;\"><span style=\"color: #222222;\"><span>Complete a Video Conference or Phone Interview  email, call, or use your account dashboard to request a time to talk to an evaluator. This is typically scheduled within 24-48 hours and requires 40-50 minutes of actual interview time. If you have never done a videoconference before, we will be glad to help you with the simple setup process.</span></span></span></span></li>\r\n 	<li><span><span style=\"font-size: medium;\"><span style=\"color: #222222;\"><span >Email, Fax, or Upload necessary documentation  If you are seeking an evaluation to reinstate your license with a DMV or BMV we may need to review additional documents from your state to be compliant with state requirements.\r\nWait for Your Evaluator to Post Your Report  Once the report is ready you may view/download/print your report and send it to the person of your choice.</span></span></span></span>\r\n<ul>\r\n 	<li><span><span style=\"font-size: medium;\"><span style=\"color: #222222;\"><span >Evaluators post reports within 24 hours of completion of the previous steps. Reports are addressed to the party of your choice.</span></span></span></span></li>\r\n 	<li><span><span style=\"font-size: medium;\"><span style=\"color: #222222;\"><span >Some assessments for a drivers license reinstatement add more steps depending on the requirements of the state. For example, some states require supporting information from third parties for a complete evaluation.</span></span></span></span></li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<span><span style=\"font-size: medium;\"><span style=\"color: #222222;\"><span >If you need any technical support as you go through the process just email us at</span></span><span style=\"color: #0000ff;\"><u><a href=\"mailto:info@drugsandalcoholassessment.com\" target=\"_blank\" rel=\"noopener\"><span style=\"color: #1155cc;\"><span >info@drugsandalcoholassessment.com</span></span></a></u></span><span style=\"color: #222222;\"><span> or call us<a href=\"tel:1-833- 573-7658\" style=\"color: #1155cc;\">1-833- 573-7658</a></span></span></span></span>', 'Assessments', '', 'inherit', 'closed', 'closed', '', '14-revision-v1', '', '', '2019-01-09 12:21:09', '2019-01-09 12:21:09', '', 14, 'http://46.101.255.67/Drugsandalcoholassesment/14-revision-v1/', 0, 'revision', '', 0),
